import React from 'react'

const NuestrosClientes = () => {
    const empresas = [
      { nombre: "La Cumbre", logo: "ruta/la-cumbre.png" },
      { nombre: "Axel", logo: "ruta/axel.png" },
      { nombre: "Recreo", logo: "ruta/recreo.png" },
      { nombre: "Cremac", logo: "ruta/cremac.png" },
      { nombre: "Sobrero Cagnolo", logo: "ruta/sobrero-cagnolo.png" },
      { nombre: "Cicarelli", logo: "ruta/cicarelli.png" }
    ];
  
    return (
      <Container className="text-center my-5">
        <h2 className="mb-4">EMPRESAS QUE CONF√çAN EN NOSOTROS</h2>
        <Row className="justify-content-center">
          {empresas.map((empresa, index) => (
            <Col key={index} xs={6} sm={4} md={2} className="mb-3">
              <img src={empresa.logo} alt={empresa.nombre} className="img-fluid" />
            </Col>
          ))}
        </Row>
      </Container>
    );
  }; 

  
export default NuestrosClientes;
